import React from "react";
import ItemForm from "./SaveNewItem";
import './NewItemAdded.css';
const NewItemAdded =(props)=> {

    const SaveDataHandler =(InputNewData)=> {
        const AddData = {
            ...InputNewData,
            id: Math.random().toString()
        };
        console.log(AddData);
        props.onSave(AddData);
    };    
    return (
        <div>
            <div className="newItem">
                <ItemForm OnSaveData={SaveDataHandler}/>
            </div>
        </div>
    )
}

export default NewItemAdded;
